		pcirc[i][j].pos_txt.show();
		pcirc[i][j].neg_txt.show();
		pcirc[i][j].prev_txt.show();
		pcirc[i][j].pie.show();
}


function getUnHoverhandler(i, j)
{
		//console.log(pcirc[i][j].lab+",i="+ii+',j='+jj);
		pcirc[i][j].lab_txt.hide();
		pcirc[i][j].test_txt.hide();
		pcirc[i][j].total_txt.hide();
		pcirc[i][j].pos_txt.hide();
		pcirc[i][j].neg_txt.hide();
		pcirc[i][j].prev_txt.hide();
		pcirc[i][j].pie.hide();
}

function hideAllCircles()
{
	for(i = 0; i < jlids.length; i++)
	{
		for(j = 1; j <= tw; j++)
		{
			pcirc[i][j].drawing.hide();
			pcirc[i][j].labloc.hide();
		}
	}
}
function transitionHandler(val)
{
	hideAllCircles();
	//val =  $( "#slider" ).slider( "value" );
	//console.log(val);
	showWeek(val);
}

function showWeek(v)
{
	j = v;
	for(i = 0; i < jlids.length; i++)
	{
		
			pcirc[i][j].drawing.show();
			pcirc[i][j].labloc.show();
		
	}
	val = $( "#slider" ).slider( "value");
	//console.log("->"+val);
	str = "Week " + val + "<br>" + jdat[0].prev[val][0];
	document.getElementById("week").innerHTML=str;
}

function weeklyTransitionPrevStart()
{
	 //window.setInterval(weeklyTransitionPrevHandler(),1000);
	  prevIntervalFunc = setInterval(function(){weeklyTransitionPrevHandler()},1000);
}

function weeklyTransitionPrevStop()
{
	 //window.setInterval(weeklyTransitionPrevHandler(),1000);
	  clearInterval(prevIntervalFunc);
}

function weeklyTransitionPrevHandler()
{
	//intervalCounter--;
	val =  $( "#slider" ).slider( "value");
	val++;
	if(val > $( "#slider" ).slider( "option", "max"))
		val = 1;
	$( "#slider" ).slider( "value", val);
	//console.log("->"+val);
	str = "Week " + val + "<br>" + jdat[0].prev[val][0];
	document.getElementById("week").innerHTML=str;
}

function playClick()
{
	$('#play').hide();
	$('#pause').show();
	weeklyTransitionPrevStart();
}


function pauseClick()
{
	$('#pause').hide();
	$('#play').show();
	weeklyTransitionPrevStop();
}

